import React from "react";

const kontakt = () => {
  return (
    <div className='dummy'>
      <h1 className='dummyText'>Anmelden</h1>

      <form>
        <div class='six columns'>
          <label for='exampleEmailInput'>Your email</label>
          <input
            class='u-full-width'
            type='email'
            placeholder='test@mailbox.com'
            id='exampleEmailInput'
          ></input>
        </div>
      </form>
    </div>
  );
};

export default kontakt;
